  return (
    <Wrapper>
      <button className="btn btn-info btn-sm" onClick={viewHandleShow}>
        View
      </button>
      <Modal
        size="xl"
        show={show.view}
        onHide={viewHandleClose}
        animation={false}
      >
        <Modal.Header closeButton>
          <Modal.Title>Modal heading</Modal.Title>
        </Modal.Header>
        <Modal.Body></Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={viewHandleClose}>
            Close
          </Button>
          <Button variant="primary" onClick={viewHandleClose}>
            Save Changes
